import React from 'react'
import FavoritesLink from './FavoritesLink.js'
import './Sidebar.css'

export default class CategoriesDiv extends React.Component {
render() {
    let categoriesArray =Array.from(new Set(this.props.articles.categories));
    
    return (
        <div id="categoriesDiv">
            {categoriesArray.map(function (category) {
                return <FavoritesLink category={category} />
            })}
        </div>
    );
}
}
